//imports
//import { useRef, useState } from "react";
import PropertyInput from "../PropertyInput/PropertyInput";
import './PropertyGroup.scss';

//interface
// const iPropertyGroup = { //interface?
    //dataGroup : [] //Array<obj>

// };

//exports
export default function PropertyGroup(props) {
    //dataGroup
    const dataGroup = props.componentData.dataGroup; //Array<obj>

    if (dataGroup) {
        const generateDataGroups = () => {
            if (dataGroup.length > 0) {
                dataGroup.map((group) => {
                    const dataGroupKeys = Object.keys(group);

                    if (dataGroupKeys.length > 0) {
                        dataGroupKeys.map((dataKey, index) => {
                            console.log(group[dataKey]);
                            if (dataKey === "ID") {
                                return <></>
                                
                            } else {
                                return (
                                    <PropertyInput key={ index } componentData={ group[dataKey] } />
                                )
                            }
                        });
                    }

                    return <></>
                });
            } else {
                return <p>No Data Groups</p>

            }
        };

        //functions

        //variables
        const componentClass = "PropertyGroup"; //string
        
        return (
            <div className={ componentClass }>
                <div className="inner">
                    { generateDataGroups() }
                    
				{/* <PropertyInput componentData={
					{ 
						dataObject : {
							allowMultiple : false,
							duplicateFields : [],
							name : "color",
							description : "this is a description",
							type : "text",
							values : [],
							units : [],
							scales : [],        
							items : []
						}
					} 
				} /> */}
                </div>
            </div>
        )

    } else {
        return (
            <p>Data Group Does Not exist</p>
        )
    }
}
